import React from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Carousel from 'react-bootstrap/Carousel';
import 'bootstrap/dist/css/bootstrap.min.css'; // Bootstrap CSS 임포트



// 네비게이션 바 컴포넌트
function ColorSchemesExample() {
  return (
    <Navbar bg="dark" data-bs-theme="dark" fixed="top" style={{ height: '80px' }}>
      <Container>
        <Navbar.Brand href="#home" style={{ fontSize: '1.5rem', color: '#ffffff' }}>
          개발팀
        </Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link href="#공지사항" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            공지사항
          </Nav.Link>
          <Nav.Link href="#프로젝트관리" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            프로젝트 관리
          </Nav.Link>
          <Nav.Link href="#자료실" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            자료실
          </Nav.Link>
          <Nav.Link href="#개발도구" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            개발 도구
          </Nav.Link>
          <Nav.Link href="#일정회의" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            일정 및 회의
          </Nav.Link>
          <Nav.Link href="#팀원정보" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            팀원 정보
          </Nav.Link>
          <Nav.Link href="#faq" style={{ fontSize: '1.2rem', color: '#ffffff' }}>
            FAQ
          </Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
}


// 캐러셀 이미지 컴포넌트
function ExampleCarouselImage({ text, imageUrl }) {
    return (
      <div
        style={{
          width: '500spx',
          height: 'auto',
          backgroundColor: '#ddd',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          paddingTop: '20px',
          fontSize: '2rem',
        }}
      >
        <img src={imageUrl} alt={text} style={{ width: '100%', height: 'auto', objectFit: 'cover' }} />
      </div>
    );
  }

  function UncontrolledExample() {
    return (
      <Carousel>
        <Carousel.Item>
          <ExampleCarouselImage 
            text="First slide" 
            imageUrl="https://i.namu.wiki/i/xZr2dbPytysrk0LuNJPUWzVZFTWCdgiv82icZ9g4WF90bAHrtwj63y0gymihzqCNb5gW9YS15a0dgl96jnHyMA.webp" 
          />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <ExampleCarouselImage 
            text="Second slide" 
            imageUrl="https://i.namu.wiki/i/xZr2dbPytysrk0LuNJPUWzVZFTWCdgiv82icZ9g4WF90bAHrtwj63y0gymihzqCNb5gW9YS15a0dgl96jnHyMA.webp" 
          />
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <ExampleCarouselImage 
            text="Third slide" 
            imageUrl="https://i.namu.wiki/i/xZr2dbPytysrk0LuNJPUWzVZFTWCdgiv82icZ9g4WF90bAHrtwj63y0gymihzqCNb5gW9YS15a0dgl96jnHyMA.webp" 
          />
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    );
  }


// 합친 메인 컴포넌트
function HomePage() {
  return (
    <>
      {/* 네비게이션 바 */}
      <ColorSchemesExample />

      {/* 네비게이션 바 아래 여백 추가 */}
      <div style={{ marginTop: '0px' }}>
        {/* 캐러셀 */}
        <UncontrolledExample />
      </div>
    </>
  );
}

export default HomePage;
